    yystate(109, Ics, Line, Tlen+1, 5, Tlen);
yystate(121, [C|Ics], Line, Tlen, _, _) when C >= 97, C =< 100 ->
    yystate(109, Ics, Line, Tlen+1, 5, Tlen);
